import React, { useState } from 'react';
import { Link } from 'react-router-dom';

const ProfilePage = () => {
  const [isOpen, setIsOpen] = useState(false);
  const [formData, setFormData] = useState({
    firstName: 'John',
    lastName: 'Doe',
    email: 'johndoe@example.com',
    nationalId: '123456789',
    university: 'Science',
    academicLevel: 'Level 3',
  });
  const imageUrl = require('./img/2.jpg').default;

  const toggleDropdown = () => {
    setIsOpen(!isOpen);
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value,
    });
  };

  return (
    <>
      <nav className="bg-gray-900 md:flex flex-col md:flex-row md:space-x-2 p-4 space-x-0 md:space-y-0 fixed w-full top-0 z-10  hover:bg-white hover:border-b-2 border-black">
        <div className="container mx-auto flex justify-end items-center md:justify-between md:items-center">
          <div className="flex justify-end items-center w-full md:w-auto">
            <Link to="/" className="text-yellow-500 text-4xl font-bold md:mb-0 mb-4 md:mb-0 hover:text-black">Even<span className="text-red-600">D</span>ango</Link>
            <button
              onClick={toggleDropdown}
              className="md:hidden text-yellow-500 hover:text-black focus:outline-none"
            >
              â˜°
            </button>
          </div>
          <ul className={`md:flex flex-col md:flex-row md:space-x-2 p-4 space-x-0 md:space-y-0 ${isOpen ? 'block' : 'hidden'}`}>
            <li><Link to="/home" className="text-yellow-600 hover:text-black m-2 font-blond">Home</Link></li>
            <li><Link to="/profile" className="text-yellow-600 hover:text-black m-2 font-blond">Profile</Link></li>
            <li><Link to="/about" className="text-yellow-600 hover:text-black m-2 font-blond">About</Link></li>
            <li><Link to="/contact" className="text-yellow-600 hover:text-black m-2 font-blond">Contact</Link></li>
          </ul>
        </div>
      </nav>

      <div className="rounded-lg border bg-card text-card-foreground shadow-sm w-full max-w-3xl mx-auto mt-20" data-v0-t="card">
        <div className="flex flex-col space-y-1.5 p-6">
          <h3 className="whitespace-nowrap font-semibold tracking-tight text-xl">Profile</h3>
          <p className="text-sm text-muted-foreground">Personal information</p>
        </div>
        <div className="p-6 grid gap-4">
          <div className="flex items-center space-x-4">
            <div className="rounded-full overflow-hidden w-12 h-12">
              <img
                src={imageUrl}
                alt="Avatar"
                width="48"
                height="48"
                className="rounded-full border aspect-square object-cover"
              />
            </div>
            <div className="grid gap-1.5">
              <h2 className="text-lg font-bold tracking-tighter">{formData.firstName} {formData.lastName}</h2>
              <p className="text-sm text-gray-500 dark:text-gray-400">National ID: {formData.nationalId}</p>
            </div>
          </div>
          <div className="grid gap-1.5">
            <p className="text-sm">College: {formData.university}</p>
            <p className="text-sm">Academic level: {formData.academicLevel}</p>
          </div>
          <div className="grid gap-1.5">
            <p className="text-sm">Email: {formData.email}</p>
          </div>
        </div>
        <div className="flex justify-end p-6">
          <button className="inline-flex items-center justify-center whitespace-nowrap text-sm font-medium ring-offset-background transition-colors focus-visible:outline-none focus-visible:ring-2 focus-visible:ring-ring focus-visible:ring-offset-2 disabled:pointer-events-none disabled:opacity-50 bg-primary text-primary-foreground hover:bg-primary/90 h-9 rounded-md px-3">
            Edit
          </button>
        </div>
      </div>
    </>
  );
};

export default ProfilePage;
